function Navigation () {
    return (
        <nav className="nav">
            <ul>
                <li><a href="#">Posts</a></li>
                <li><a href="#">Todo</a></li>
                <li><a href="#">Users</a></li>
            </ul>
        </nav>
    )
}

export default Navigation;
